import React from 'react';
import { useEffect, useState } from 'react';
import axios from "axios";
import Display from './Display';

function HomePage() {
    const [apiDefData, setapiDefData] = useState([]);
    const clientId = "VMNtA6LkhbRHFKUyh3yPEFVMX32J_QqrHYwkdln5hbA";
    useEffect(() => {
          const url =
            "https://api.unsplash.com/photos?page=&per_page=18&&client_id=" +
            clientId;
          axios.get(url).then((result) => {
            setapiDefData(result.data.results);
            console.log("API DATA === ", apiDefData);
          });
      },);
    return (
        <div>
            <div className="home-title">
                <h2>Download High Quality Images by creators.</h2>
                <div>Over 2.4 million+ stock by our talented community</div>
            </div>
            <div>
            {apiDefData.map((photo, index) => (
            <Display apiDefDataP={photo} index={index}></Display>
          ))}
            </div>
        </div>
    )
}

export default HomePage
